import React from 'react';
import EmployeeManagement from '../features/EmployeeManagement';
import Sidebar from '../components/Sidebar';

const EmployeesPage: React.FC = () => {
  return (
    <div style={{ width: '100vw', minHeight: '100vh', display: 'flex' }}>
      <Sidebar />
      <div style={{ maxWidth: 850, width: '100%', padding: 10, marginLeft: 180, background: '#f5f7fa', borderRadius: 12, boxShadow: '0 4px 16px #e0e0e0', display: 'flex', flexDirection: 'column', alignItems: 'center', margin: '32px 0 0 32px' }}>
        <h2 style={{ textAlign: 'center', marginBottom: 18, fontSize: '1.3rem', fontWeight: 600 }}>Employees</h2>
        <EmployeeManagement />
      </div>
    </div>
  );
};

export default EmployeesPage;
